import React, {Component} from 'react';
import { View, Text } from 'react-native';


export class DetailsCategoriaScreen extends Component {

    constructor(props){
        super(props);
        this.state={
            nombres: [],
            encontrado: true,
            unaVez: false,
        }
    }
    
    render(){
        return(
            <View>
                <Text>FELICIDADES!</Text>
            </View>
        );
    }

}
